import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    menuButton: {
        backgroundColor: '#F3E05E',
        flexDirection: "row",
        justifyContent: "center",
        fontSize: 46
    },
    menuButton_icon:{
        width: 90,
        height: 90,
    },
    menuButton_text:{
        color: '#FFFFFF',
        fontSize: 46,
    }
});

export default styles
